import React, { useContext, useEffect, useState } from "react";
import "../../styles/home.css";
import { Context } from "../store/appContext";
import { Card } from "../component/Card.jsx";
import { Link } from "react-router-dom";
import "../../font/StarJedi.ttf";

export const Home = () => {

	const { store, actions } = useContext(Context)
	const [search, setSearch] = useState("");
	const [data, setData] = useState([]); // Todos los datos combinados
	const [filtroResultado, setFiltroResultado] = useState([]);

	useEffect(() => {
		actions.llamarTodoLocalStorage()
	}, [])

	useEffect(() => {
		const categoria = ["characters", "planets", "species", "starships", "vehicles", "films"];
		const combinedData = [];

		categoria.forEach((category) => {
			const items = JSON.parse(localStorage.getItem(category)) || [];
			items.forEach((item) => {
				if (item.name || item.title) {
					combinedData.push({
						...item,
						displayName: item.name || item.title,
						type: category,
					});
				}
			});
		});

		setData(combinedData);
	}, []);

	useEffect(() => {
		if (search.trim() === "") {
			setFiltroResultado([]);
		} else {
			const results = data.filter((item) =>
				item.displayName.toLowerCase().includes(search.toLowerCase())
			);
			setFiltroResultado(results);
		}
	}, [search, data]);


	const handleBuscar = (e) => {
		setSearch(e.target.value);
	};


	return (
		<div className="text-center mt-3 p-3">
			<img className="img-fluid p-1" src="https://fontmeme.com/permalink/241219/23e355daae3a2452f75758d0a671f8ec.png" alt="fuente-de-star-wars" border="0" />
			<div className="row">
				<ul className="nav nav-pills mb-3 d-flex justify-content-center" id="pills-tab" role="tablist">
					<li className="nav-item" role="presentation">
						<button className=" btn btn-outline-warning encabezado" id="pills-personajes-tab" data-bs-toggle="pill" data-bs-target="#pills-personajes" type="button" role="tab" aria-controls="pills-home" aria-selected="true"><img src="https://fontmeme.com/permalink/241219/3f5e088a8c91d35ce46f343393a4bc80.png" alt="fuente-de-star-wars" border="0" /></button>
					</li>
					<li className="nav-item" role="presentation">
						<button className="btn btn-outline-warning encabezado" id="pills-especies-tab" data-bs-toggle="pill" data-bs-target="#pills-especies" type="button" role="tab" aria-controls="pills-profile" aria-selected="false"><img src="https://fontmeme.com/permalink/241219/1d4b06e01d8b087adbd89d1312c2751b.png" alt="fuente-de-star-wars" border="0" /></button>
					</li>
					<li className="nav-item" role="presentation">
						<button className="btn btn-outline-warning encabezado" id="pills-planetas-tab" data-bs-toggle="pill" data-bs-target="#pills-planetas" type="button" role="tab" aria-controls="pills-contact" aria-selected="false"><img src="https://fontmeme.com/permalink/241219/6819e67e790b0d6c05bbfddd833af0d7.png" alt="fuente-de-star-wars" border="0" /></button>
					</li>
					<li className="nav-item" role="presentation">
						<button className="btn btn-outline-warning encabezado" id="pills-naves-tab" data-bs-toggle="pill" data-bs-target="#pills-naves" type="button" role="tab" aria-controls="pills-contact" aria-selected="false"><img src="https://fontmeme.com/permalink/241219/a3f2b74d026771dcc790532fd3f25066.png" alt="fuente-de-star-wars" border="0" /></button>
					</li>
					<li className="nav-item" role="presentation">
						<button className="btn btn-outline-warning encabezado" id="pills-vehiculos-tab" data-bs-toggle="pill" data-bs-target="#pills-vehiculos" type="button" role="tab" aria-controls="pills-contact" aria-selected="false"><img src="https://fontmeme.com/permalink/241219/69e17727703f5e7be77fe27fd75e28fd.png" alt="fuente-de-star-wars" border="0" /></button>
					</li>
					<li className="nav-item" role="presentation">
						<button className="btn btn-outline-warning encabezado" id="pills-peliculas-tab" data-bs-toggle="pill" data-bs-target="#pills-peliculas" type="button" role="tab" aria-controls="pills-contact" aria-selected="false"><img src="https://fontmeme.com/permalink/241219/341c667bc07eec18ef86273af76a480d.png" alt="fuente-de-star-wars" border="0" /></button>
					</li>
					<li className="nav-item" role="presentation">
						<button className="btn btn-outline-warning encabezado" id="pills-buscar-tab" data-bs-toggle="pill" data-bs-target="#pills-buscar" type="button" role="tab" aria-controls="pills-contact" aria-selected="false"><img src="https://fontmeme.com/permalink/241219/bd601346464ca16dbcf57c3f9f8036c5.png" alt="fuente-de-star-wars" border="0" /></button>
					</li>
				</ul>
				<div className="tab-content container" id="pills-tabContent">
					<div className="tab-pane fade" id="pills-personajes" role="tabpanel" aria-labelledby="pills-personajes-tab" tabIndex={"0"}>
						<div className="row">
							{store.characters?.map((characters) => (
								<div className="col-12 col-md-2 mb-4 p-3 estilo" key={characters.uid}>
									<Link className="estilo" to={`/single/characters/${characters.uid}`} >
										<Card
											Foto={`https://starwars-visualguide.com/assets/img/characters/${characters.uid}.jpg`}
											Nombre={characters.name}
											Favorito={(e) => { e.preventDefault(); actions.addToFavorites(characters, "characters") }}
										/>
									</Link>
								</div>
							))}
						</div>
					</div>
					<div className="tab-pane fade" id="pills-especies" role="tabpanel" aria-labelledby="pills-especies-tab" tabIndex={"0"}>
						<div className="row">
							{store.species?.map((species) => (
								<div className="col-12 col-md-2 mb-4 p-3" key={species.uid}>
									<Link className="estilo" to={`/single/species/${species.uid}`} >
										<Card
											Foto={`https://starwars-visualguide.com/assets/img/species/${species.uid}.jpg`}
											Nombre={species.name}
											Favorito={(e) => { e.preventDefault(); actions.addToFavorites(species, "species") }}
										/>
									</Link>
								</div>
							))}
						</div>
					</div>
					<div className="tab-pane fade" id="pills-planetas" role="tabpanel" aria-labelledby="pills-planetas-tab" tabIndex={"0"}>
						<div className="row">
							{store.planets?.map((planets) => (
								<div className="col-12 col-md-2 mb-4 p-3" key={planets.uid}>
									<Link className="estilo" to={`/single/planets/${planets.uid}`} >
										<Card
											Foto={`https://starwars-visualguide.com/assets/img/planets/${planets.uid}.jpg` || "https://img.freepik.com/fotos-premium/ilustracion-enorme-signo-interrogacion-planeta-tierra-imagen-generada-ia_1009902-10826.jpg?w=740"}
											OnError={(e) => {
												e.target.src = "https://img.freepik.com/fotos-premium/ilustracion-enorme-signo-interrogacion-planeta-tierra-imagen-generada-ia_1009902-10826.jpg?w=740"
											}}
											Nombre={planets.name}
											Favorito={(e) => { e.preventDefault(); actions.addToFavorites(planets, "planets") }}
										/>
									</Link>
								</div>
							))}
						</div>
					</div>
					<div className="tab-pane fade" id="pills-naves" role="tabpanel" aria-labelledby="pills-naves-tab" tabIndex={"0"}>
						<div className="row">
							{store.starships?.map((starships) => (
								<div className="col-12 col-md-2 mb-4 p-3" key={starships.uid}>
									<Link className="estilo" to={`/single/starships/${starships.uid}`} >
										<Card
											Foto={`https://starwars-visualguide.com/assets/img/starships/${starships.uid}.jpg`}
											OnError={(e) => { e.target.src = ("data:image/jpeg;base64,") }}
											Nombre={starships.name}
											Favorito={(e) => { e.preventDefault(); actions.addToFavorites(starships, "starships") }}
										/>
									</Link>
								</div>
							))}
						</div>
					</div>
					<div className="tab-pane fade" id="pills-vehiculos" role="tabpanel" aria-labelledby="pills-vehiculos-tab" tabIndex={"0"}>
						<div className="row">
							{store.vehicles?.map((vehicles) => (
								<div className="col-12 col-md-2 mb-4 p-3" key={vehicles.uid}>
									<Link className="estilo" to={`/single/vehicles/${vehicles.uid}`} >
										<Card
											Foto={`https://starwars-visualguide.com/assets/img/vehicles/${vehicles.uid}.jpg`}
											OnError={(e) => { e.target.src = ("data:image/jpeg;base64,") }}
											Nombre={vehicles.name}
											Favorito={(e) => { e.preventDefault(); actions.addToFavorites(vehicles, "vehicles") }}
										/>
									</Link>
								</div>
							))}
						</div>
					</div>
					<div className="tab-pane fade" id="pills-peliculas" role="tabpanel" aria-labelledby="pills-peliculas-tab" tabIndex={"0"}>
						<div className="row">
							{store.films?.map((films) => (
								<div className="col-12 col-md-2 mb-4 p-3" key={films.uid}>
									<Link className="estilo" to={`/single/films/${films.uid}`} >
										<Card
											Foto={`https://starwars-visualguide.com/assets/img/films/${films.uid}.jpg`}
											Nombre={films.properties.title}
											Comentario={films.properties.release_date}
											Favorito={(e) => { e.preventDefault(); actions.addToFavorites(films, "films") }}
										/>
									</Link>
								</div>
							))}
						</div>
					</div>
					<div className="tab-pane fade show active" id="pills-buscar" role="tabpanel" aria-labelledby="pills-buscar-tab" tabIndex={"0"}>
						<div className="container mt-5">
							<h2 className="text-center encabezado">Escribe el nombre o titulo</h2>
							<input
								type="text"
								className="form-control"
								placeholder="Buscar personajes, planetas, especies, etc."
								value={search}
								onChange={handleBuscar}
							/>
							{filtroResultado.length > 0 && (
								<ul className="list-group mt-3">
									{filtroResultado.map((item, index) => (
										<li key={index} className="list-group-item">
											<Link to={`/single/${item.type}/${item.uid}`}>{item.displayName}</Link>
										</li>
									))}
								</ul>
							)}
						</div>
					</div>
				</div>
			</div>
		</div >
	)

};
